12-year-old Dre Parker (Smith) relocates to China thanks to his mother's latest career change. Struggling to fit in Dre immediately falls for his classmate Mei Ying, this however causes problems with the class bully Cheng. To defend himself Dre must turn to maintenance man Mr. Han (Chan), who is secretly a master of kung fu, and soon realises that facing down the bullies will be the fight of his life.



